import React, { useState } from "react";

type Props = {
  data: any;
  path?: string[];
  onEdit: (path: string[], value: any) => void;
};

export const EditableJsonTree: React.FC<Props> = ({ data, path = [], onEdit }) => {
  const [editing, setEditing] = useState<{ key: string; value: any } | null>(null);

  if (typeof data !== "object" || data === null) {
    return (
      <span>
        {editing ? (
          <>
            <input
              value={editing.value}
              onChange={e => setEditing({ ...editing, value: e.target.value })}
            />
            <button onClick={() => { onEdit(path, editing.value); setEditing(null); }}>Save</button>
            <button onClick={() => setEditing(null)}>Cancel</button>
          </>
        ) : (
          <>
            <span>{String(data)}</span>
            <button onClick={() => setEditing({ key: "", value: data })}>Edit</button>
          </>
        )}
      </span>
    );
  }

  return (
    <ul>
      {Object.entries(data).map(([key, value]) => (
        <li key={key}>
          <strong>{key}:</strong>{" "}
          <EditableJsonTree
            data={value}
            path={[...path, key]}
            onEdit={onEdit}
          />
        </li>
      ))}
    </ul>
  );
};
````

