// ...existing code...

const Node = ({ node, x, y }: CustomNodeProps) => {
  const [modalOpen, setModalOpen] = useState(false);
  const [editContent, setEditContent] = useState("");
  const [editPath, setEditPath] = useState<string | null>(null);

  // Get the full JSON from your store
  const jsonString = useFile(state => state.contents);
  const setContents = useFile(state => state.setContents);

  // Helper to get the node's JSON by path (implement as needed)
  function getNodeJson(path: string) {
    try {
      const json = JSON.parse(jsonString);
      // Traverse json using path, e.g., "fruit"
      return path.split(".").reduce((acc, key) => acc?.[key], json);
    } catch {
      return null;
    }
  }

  // When a row is clicked, open modal with its content
  function handleRowClick(key: string) {
    setEditPath(key);
    const nodeJson = getNodeJson(key);
    setEditContent(JSON.stringify(nodeJson, null, 2));
    setModalOpen(true);
  }

  // Save edited content back to store
  function handleSave() {
    try {
      const json = JSON.parse(jsonString);
      // Update the json at editPath with new content
      // For simplicity, assume editPath is a top-level key
      if (editPath) {
        json[editPath] = JSON.parse(editContent);
        setContents({ contents: JSON.stringify(json, null, 2) });
      }
      setModalOpen(false);
    } catch (e) {
      alert("Invalid JSON");
    }
  }

  return (
    <>
      <Styled.StyledForeignObject
        data-id={`node-${node.id}`}
        width={node.width}
        height={node.height}
        x={0}
        y={0}
        $isObject
      >
        {(node.text as Value[]).map((val, idx) => (
          <Row
            val={val}
            index={idx}
            x={x}
            y={y}
            key={idx}
            onClick={() => handleRowClick(val[0])}
          />
        ))}
      </Styled.StyledForeignObject>
      <Modal opened={modalOpen} onClose={() => setModalOpen(false)} title="Node Content">
        <div>
          <div style={{ display: "flex", justifyContent: "space-between" }}>
            <span>Content</span>
            <Button onClick={() => setEditContent(editContent)} size="xs">Edit</Button>
          </div>
          <Textarea
            value={editContent}
            onChange={e => setEditContent(e.target.value)}
            autosize
            minRows={5}
            disabled={false}
            style={{ fontFamily: "monospace", marginTop: 8 }}
          />
          <div style={{ marginTop: 16 }}>
            <span>JSON Path</span>
            <div style={{ fontFamily: "monospace", background: "#222", color: "#fff", padding: 4 }}>
              {`{Root}.${editPath}`}
            </div>
          </div>
          <Button onClick={handleSave} mt="md" fullWidth>
            Save
          </Button>
        </div>
      </Modal>
    </>
  );
};
